import React from "react";
import "./VideoTracker.css"; // Assurez-vous que le chemin est correct

const VideoTracker = () => {
  return (
    <div>
      <header className="banner">
        <div className="banner-content">
          {/* Conteneur pour le titre et le sous-titre */}
          <div className="banner-text">
            <h1 className="banner-title">Product Database</h1>
            <p className="banner-subtitle">
              Search millions of products and see their revenue
            </p>
          </div>
          {/* Conteneur séparé pour les boutons, permettant un alignement à droite */}
          <div className="banner-buttons">
            <button className="banner-button">Take Tour</button>
            <button className="banner-button">Watch Tutorial</button>
          </div>
        </div>
      </header>
      <div className="main-content">
        <div className="filters-section">
          {/* Exemple de groupe de filtres */}
          <div className="filter-group">
            <label className="filter-label">Price</label>
            <input type="text" className="filter-input" placeholder="Min" />
            <input type="text" className="filter-input" placeholder="Max" />
          </div>
          {/* Ajoutez d'autres groupes de filtres ici */}
        </div>
        <div className="categories-section">
          {/* Exemple de tags de catégories */}
          <div className="category-tag">Appliances</div>
          <div className="category-tag">Arts Crafts & Sewing</div>
          {/* Ajoutez d'autres tags de catégories ici */}
        </div>
      </div>
    </div>
  );
};

export default VideoTracker;
